import React from 'react';
import EndpointItem from './EndpointItem';

const Brand = ({ openEndpoint, setOpenEndpoint }) => {
  const endpoints = [
    {
      method: 'GET',
      path: '/api/brands',
      description: 'Lấy danh sách thương hiệu',
      fullDescription: 'Trả về danh sách tất cả các thương hiệu có trạng thái `show`. Không yêu cầu xác thực, có thể truy cập công khai.',
      auth: {
        required: false,
        description: 'Không yêu cầu token. Endpoint này có thể truy cập công khai.'
      },
      parameters: [],
      response: {
        status: 200,
        description: 'Danh sách thương hiệu',
        example: [
          {
            _id: '60d5f8e9b1a2b4f8e8f9e2b7',
            name: 'Thương hiệu A',
            status: 'show',
            logoImg: 'images/brandA-logo.png'
          },
          {
            _id: '60d5f8e9b1a2b4f8e8f9e2b8',
            name: 'Thương hiệu B',
            status: 'show',
            logoImg: 'images/brandB-logo.png'
          }
        ]
      },
      errorResponses: [
        { status: 404, description: 'Không tìm thấy thương hiệu nào' },
        { status: 500, description: 'Lỗi máy chủ' }
      ]
    },
    {
      method: 'GET',
      path: '/api/brands/:id',
      description: 'Lấy chi tiết thương hiệu',
      fullDescription: 'Trả về thông tin chi tiết của một thương hiệu dựa trên ID. Không yêu cầu xác thực.',
      auth: {
        required: false,
        description: 'Không yêu cầu token. Endpoint này có thể truy cập công khai.'
      },
      parameters: [
        { name: 'id', type: 'string', description: 'ObjectId của thương hiệu', required: true }
      ],
      response: {
        status: 200,
        description: 'Chi tiết thương hiệu',
        example: {
          _id: '60d5f8e9b1a2b4f8e8f9e2b7',
          name: 'Thương hiệu A',
          status: 'show',
          logoImg: 'images/brandA-logo.png'
        }
      },
      errorResponses: [
        { status: 404, description: 'Không tìm thấy thương hiệu' },
        { status: 500, description: 'Lỗi máy chủ' }
      ]
    },
    {
      method: 'POST',
      path: '/api/brands',
      description: 'Tạo thương hiệu mới',
      fullDescription: 'Tạo một thương hiệu mới với tên, trạng thái tùy chọn (mặc định là `show`), và hình ảnh logo (bắt buộc). Yêu cầu quyền admin thông qua token JWT. Dữ liệu được gửi dưới dạng `multipart/form-data`.',
      auth: {
        required: true,
        header: 'Authorization: Bearer <token>',
        description: 'Token JWT của admin được yêu cầu trong header'
      },
      parameters: [
        { name: 'name', type: 'string', description: 'Tên thương hiệu, phải duy nhất', required: true },
        { name: 'status', type: 'string', description: 'Trạng thái của thương hiệu (`show` hoặc `hidden`, mặc định là `show`)', required: false },
        { name: 'logoImg', type: 'file', description: 'Hình ảnh logo (jpg, jpeg, png, gif, webp, svg; tối đa 20MB)', required: true }
      ],
      requestExample: {
        headers: { 'Authorization': 'Bearer <token>', 'Content-Type': 'multipart/form-data' },
        body: {
          name: 'Thương hiệu mới',
          status: 'show',
          logoImg: 'newbrand-logo.png'
        }
      },
      response: {
        status: 201,
        description: 'Tạo thương hiệu thành công',
        example: {
          message: 'Tạo thương hiệu thành công',
          brand: {
            _id: '60d5f8e9b1a2b4f8e8f9e2b9',
            name: 'Thương hiệu mới',
            status: 'show',
            logoImg: 'images/newbrand-logo.png'
          }
        }
      },
      errorResponses: [
        { status: 400, description: 'Tên thương hiệu đã tồn tại hoặc dữ liệu không hợp lệ' },
        { status: 400, description: 'Vui lòng upload hình ảnh logo' },
        { status: 400, description: 'Chỉ hỗ trợ file ảnh (jpg, jpeg, png, gif, webp, svg)' },
        { status: 401, description: 'Không có token hoặc token không hợp lệ' },
        { status: 403, description: 'Không có quyền admin' },
        { status: 500, description: 'Lỗi máy chủ' }
      ]
    },
    {
      method: 'PUT',
      path: '/api/brands/:id',
      description: 'Cập nhật thương hiệu',
      fullDescription: 'Cập nhật thông tin thương hiệu (tên, trạng thái, hoặc hình ảnh logo) dựa trên ID. Hình ảnh logo là tùy chọn. Yêu cầu quyền admin thông qua token JWT. Dữ liệu được gửi dưới dạng `multipart/form-data`.',
      auth: {
        required: true,
        header: 'Authorization: Bearer <token>',
        description: 'Token JWT của admin được yêu cầu trong header.'
      },
      parameters: [
        { name: 'id', type: 'string', description: 'ObjectId của thương hiệu', required: true },
        { name: 'name', type: 'string', description: 'Tên thương hiệu mới, phải duy nhất', required: false },
        { name: 'status', type: 'string', description: 'Trạng thái mới của thương hiệu (`show` hoặc `hidden`)', required: false },
        { name: 'logoImg', type: 'file', description: 'Hình ảnh logo mới (jpg, jpeg, png, gif, webp, svg; tối đa 20MB)', required: false }
      ],
      requestExample: {
        headers: { 'Authorization': 'Bearer <token>', 'Content-Type': 'multipart/form-data' },
        body: {
          name: 'Thương hiệu cập nhật',
          status: 'show',
          logoImg: 'updated-logo.png'
        }
      },
      response: {
        status: 200,
        description: 'Cập nhật thương hiệu thành công',
        example: {
          message: 'Cập nhật thương hiệu thành công',
          brand: {
            _id: '60d5f8e9b1a2b4f8e8f9e2b7',
            name: 'Thương hiệu cập nhật',
            status: 'show',
            logoImg: 'images/updated-logo.png'
          }
        }
      },
      errorResponses: [
        { status: 400, description: 'Tên thương hiệu đã tồn tại hoặc dữ liệu không hợp lệ' },
        { status: 400, description: 'Chỉ hỗ trợ file ảnh (jpg, jpeg, png, gif, webp, svg)' },
        { status: 401, description: 'Không có token hoặc token không hợp lệ' },
        { status: 403, description: 'Không có quyền admin' },
        { status: 404, description: 'Không tìm thấy thương hiệu để cập nhật' },
        { status: 500, description: 'Lỗi máy chủ' }
      ]
    },
    {
      method: 'DELETE',
      path: '/api/brands/:id',
      description: 'Xóa thương hiệu',
      fullDescription: 'Xóa một thương hiệu dựa trên ID. Yêu cầu quyền admin thông qua token JWT.',
      auth: {
        required: true,
        header: 'Authorization: Bearer <token>',
        description: 'Token JWT của admin được yêu cầu trong header.'
      },
      parameters: [
        { name: 'id', type: 'string', description: 'ObjectId của thương hiệu', required: true }
      ],
      response: {
        status: 200,
        description: 'Xóa thương hiệu thành công',
        example: {
          message: 'Xóa thương hiệu thành công'
        }
      },
      errorResponses: [
        { status: 401, description: 'Không có token hoặc token không hợp lệ' },
        { status: 403, description: 'Không có quyền admin' },
        { status: 404, description: 'Không tìm thấy thương hiệu để xóa' },
        { status: 500, description: 'Lỗi máy chủ' }
      ]
    },
    {
      method: 'PUT',
      path: '/api/brands/:id/toggle-visibility',
      description: 'Chuyển đổi hiển thị thương hiệu',
      fullDescription: 'Chuyển đổi trạng thái hiển thị của thương hiệu giữa `show` và `hidden`. Yêu cầu quyền admin thông qua token JWT.',
      auth: {
        required: true,
        header: 'Authorization: Bearer <token>',
        description: 'Token JWT của admin được yêu cầu trong header.'
      },
      parameters: [
        { name: 'id', type: 'string', description: 'ObjectId của thương hiệu', required: true }
      ],
      response: {
        status: 200,
        description: 'Chuyển đổi trạng thái hiển thị thành công',
        example: {
          message: 'Thương hiệu đã được hiển thị',
          brand: {
            _id: '60d5f8e9b1a2b4f8e8f9e2b7',
            name: 'Thương hiệu A',
            status: 'show',
            logoImg: 'images/brandA-logo.png'
          }
        }
      },
      errorResponses: [
        { status: 401, description: 'Không có token hoặc token không hợp lệ' },
        { status: 403, description: 'Không có quyền admin' },
        { status: 404, description: 'Không tìm thấy thương hiệu' },
        { status: 500, description: 'Lỗi máy chủ' }
      ]
    }
  ];

  return (
    <>
      {endpoints.map((endpoint, index) => (
        <EndpointItem
          key={`${endpoint.path}-${index}`}
          endpoint={endpoint}
          index={index}
          openEndpoint={openEndpoint}
          setOpenEndpoint={setOpenEndpoint}
        />
      ))}
    </>
  );
};

export default Brand;
